        return(
            <main className="cartOverlayContainer">
                <span className="cartOverlayTitle">My Bag,</span>
                <span>3 items</span>
                <div className="cartOverlayContent">
                        <BagItem />
                </div>
                <div className="cartOverlayTotal">
                    <span className="totalItem">Total</span>
                    <span className="totalItem">$200.00</span>
                </div>
                <div className="cartOverlayBatton">
                    

                </div>
            </main>
        )
    }
}

